"use strict";document.addEventListener("DOMContentLoaded",function(){return watchNavbarPosition()});var watchNavbarPosition=function(){var s=document.getElementsByClassName("navbar")[0],t=s.offsetTop;rxjs.fromEvent(window,"scroll",{passive:!0}).pipe(rxjs.operators.filter(function(){return window.pageYOffset>=t&&!s.classList.contains("navbar--sticky")||window.pageYOffset<t&&s.classList.contains("navbar--sticky")})).subscribe(function(){window.pageYOffset>=t?s.classList.add("navbar--sticky"):s.classList.remove("navbar--sticky")})};